            tags: '',
            userName
        }
        this.submit = this.submit.bind(this);
    }
    submit(){
        console.log(this.state.title);
    }
    render(){
        return(
            <div>
                <h id = "question_title">
                Question Title*
                </h>
                <div id = "title_limit">
                limit title to 100 characters or less
                </div>
                <textarea id="title_input" value = {this.state.title}></textarea>
    
                <h id = "question_title">
                Question Text*
                </h>
                <div id = "title_limit">
                add detail
                </div>
                <textarea id="text_input"value={this.state.detail}></textarea>
    
                <h id = "question_title">
                Tags*
                </h>
                <div id = "title_limit">
                add keywords sepearted by space
                </div>
                <textarea id="tags_input"value ={this.state.tags}></textarea>
    
                <h id = "question_title">
                Username*
                </h>
                
                <textarea id="user_input"></textarea>
    
                <button id = "sumbit" onClick={this.submit}> Post question</button>
                <span id="remind_sumbit"> *indicates mandatory field</span>
            </div>
        );
    }
}

export default AskQuestionPage;
